import { ThemeProvider } from "@mui/styles";
import React from "react";
import useStyles from "./styles";

const Form = () => {
  const theme = {};
  const classes = useStyles(theme);
  return (
    <ThemeProvider theme={theme}>
      <h1>FORM</h1>
    </ThemeProvider>
  );
};

export default Form;
